import React from 'react';
import TopBar from './TopBar.js'

export default function PageLayout({children}) {
    return (
        <div style={{
            display: 'grid'
        }}>
            <TopBar></TopBar>
            <div>
                {children}
            </div>
        </div>
    );
}
